/*
 * Probability test program
 * Given a bag of dice, and randomly choosing one
 * What is the chance of success for drawing a 7?
 */
import java.util.*;

public class Main { public static void main(String[] args) { 
  /*
   * Create bag of dice 
   * represented as how many sides are on each
   */
  List<Integer> bagOfDice = new ArrayList<Integer>();
  for(int i=1;i<=4;i++){  // insert 4d4
    bagOfDice.add(4);
  }
  for(int i=1;i<=3;i++){  // insert 3d6 & 3d8
    bagOfDice.add(6);
    bagOfDice.add(8);
  }
  bagOfDice.add(10); // insert 1d10
  bagOfDice.add(12); // insert 1d12
  bagOfDice.add(20); // insert 1d20
  Collections.shuffle(bagOfDice);

  /*
   * draw a die and roll it
   */
  Integer[] totals = {0,0};
  Random RNG = new Random();
  for(Integer drawLoop = 1; drawLoop < 1000000; drawLoop++){
    Integer drawnDie = bagOfDice.get( RNG.nextInt(bagOfDice.size()) );
    if( RNG.nextInt(drawnDie)+1 == 7){
      totals[1]++;
    }
    else totals[0]++;
  }// draw loop 

  /*
   * Display results
   */
  System.out.println(
    String.format("Successes: %s \nFailures: %s\n%f", totals[1], totals[0], (float)totals[1]/totals[0])
  );

  } // main
} // Scratchpad class

