const BOARD_X              = 10;
const BOARD_Y              = 20;
const SPAWN_Y              = 2;
const TETROMINO_TYPE_COUNT = 7;

class AreaType {
	/**
	 * This class helps differentiate between 2 areas on the game board:
	 * 1. The normal play area. This is where things usually happen.
	 * 2. The spawn area. This area is only used when rows are too full to spawn new tetrominoes in them.
	 * @type {AreaType}
	 */
	static Spawn = new AreaType("spawn");
	static Play  = new AreaType("play");
	
	/**
	 * Create an AreaType element
	 * @param name the type of area
	 */
	constructor(name) {this.name = name;}
	
	toString() {return this.name;}
}

class Tetromino {
	/**
	 * This class defines the different Tetris pieces (Tetrominoes) and their colors.
	 * @type {Tetromino}
	 */
	static I = new Tetromino("I", "cyan");
	static L = new Tetromino("L", "orange");
	static J = new Tetromino("J", "blue");
	static Z = new Tetromino("Z", "red");
	static S = new Tetromino("S", "green");
	static T = new Tetromino("T", "purple");
	static O = new Tetromino("O", "yellow");
	
	static AllTetrominoTypes =
		       [Tetromino.I, Tetromino.L, Tetromino.J, Tetromino.Z, Tetromino.S, Tetromino.T, Tetromino.O];
	
	/**
	 * Create a Tetromino type
	 * @param name the Tetromino's name
	 * @param color the Tetromino's corresponding color
	 */
	constructor(name, color) {
		this.name  = name;
		this.color = color;
	}
	
	toString() {
		return `${this.name} Tetromino`;
	}
}

class Square {
	/**
	 * Represents a single square on the board.
	 * @param x x position of the square
	 * @param y y position of the square
	 * @param area {AreaType} the type of area the square is in
	 */
	constructor(x, y, area) {
		this.x     = x;
		this.y     = y;
		this.isSet = false; // signifies whether there is a Tetromino in this square that is set.
		
		this.element = document.createElement("div");
		this.element.classList.add(area + "Square");
	}
	
	/**
	 * Fill the square with a part of a tetromino.
	 * @param tetromino {Tetromino} the tetromino
	 * @param isSet {Boolean} if the tetromino is set in the square
	 */
	fill(tetromino, isSet) {
		this.isSet                         = isSet;
		this.element.style.backgroundColor = tetromino.color;
	}
	
	/**
	 * Empty the square of its filling
	 */
	empty() {
		this.isSet                         = false;
		this.element.style.backgroundColor = "inherit";
	}
}

class Row {
	/**
	 * Represents a single row on the board.
	 * Rows contain {@link BOARD_X} squares
	 * @param y the y position of the row
	 * @param area {AreaType} the type of area the row is in
	 */
	constructor(y, area) {
		this.y       = y;
		this.area    = area;
		this.squares = [];
		
		this.element = document.createElement("div");
		this.element.classList.add("row", "tetrisRow");
		
		for (let x = 0; x < BOARD_X; x++) {
			this.squares.push(new Square(x, y, this.area));
			this.element.appendChild(this.squares[x].element);
		}
	}
	
	/**
	 * Check if a row had all of its squares full
	 * @returns {boolean} the check's result
	 */
	checkFull() {
		let isFull = true;
		for (const square of this.squares) {
			isFull &= square.isSet;
		}
		return isFull;
	}
	
	/**
	 * empty the squares of the entire row
	 */
	clear() {
		for (const square of this.squares) {
			square.empty();
		}
	}
}

class Board {
	/**
	 * Creates a Tetris game board.
	 * A board contains {@link BOARD_Y} normal rows,
	 * and {@link SPAWN_Y} spawn rows.
	 *
	 * Boards contain rows, rows contain squares.
	 * The game is managed by the board object.
	 */
	constructor() {
		this.playElement  = document.getElementById("playBoard");
		this.spawnElement = document.getElementById("spawnBoard");
		
		this.playRows  = [];
		this.spawnRows = [];
		
		for (let y = 0; y < SPAWN_Y; y++) {
			this.spawnRows.push(new Row(y, AreaType.Spawn));
			this.spawnElement.appendChild(this.spawnRows[y].element);
		}
		
		for (let y = 0; y < BOARD_Y; y++) {
			this.playRows.push(new Row(y, AreaType.Play));
			this.playElement.appendChild(this.playRows[y].element);
		}
	}
	
	/**
	 * reset the board
	 */
	reset() {
		for (const row of this.spawnRows) {
			row.clear();
		}
		for (const row of this.playRows) {
			row.clear();
		}
	}
}

/**
 * Generate a random tetromino
 * @returns {Tetromino} a random tetromino
 */
function getRandomTetromino() {
	return Tetromino.AllTetrominoTypes[Math.floor(Math.random() * TETROMINO_TYPE_COUNT)];
}


